" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 562px\">",
"   <div class=\"ttl\">",
"    Splitting of the second heart sound",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 542px; height: 462px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Wide splitting of second heart sound (S2) may be due to delayed closure of pulmonic valve as in right bundle branch block, pulmonic stenosis, and atrial septal defect, or to early closure of aortic valve as in mitral regurgitation and ventricular septal defect. In atrial septal defect, splitting is both wide and fixed.",
"    <div class=\"footnotes\">",
"     S1: first heart sound; A2: aortic valve closure sound; P2: pulmonic valve closure sound; T1: tricuspid valve closure sound; M1: mitral valve closure sound.",
"    </div>",
